ethod: - 98% noted softer, smoother skin - 82% noticed more radiant and glowing skin - 98% of women noticed an improvement in skin texture - 88% noticed an improvement in skintoneSuggested Usage: -Prior to the first use, charge the Clarisonic handle for 24 hours. -Remove eye makeup by hand. -Wet your skin and the brush head with warm water. -Liberally apply cleanser to your skin or to the brush head. -Push the on/off button to turn your Clarisonic on and gently move the brush using a small circular motion, beginning on the forehead, then moving to the nose/chin area and the cheeks as the T-TIMER prompts. -Pressing too hard will impede the motion of the brush and reduce its effectiveness. -The outer brushes are designed to contain any residual mist from the brush oscillation, so be sure to hold the brush head flush to your skin. -The Clarisonic handle is waterproof and may be used in the shower or bathtub. -For best results, replace your Clarisonic brush head every three to four months. -Get a separate brush head for each user. -Using the Clarisonic to remove makeup may stain the bristles, but will not affect performance. -If discoloration occurs, clean the brush head with soap and water. -For best results, replace brush head every three months.Ingredients: -Proprietary Five-Source Vitamin C Complex: Brightens, supports natural collagen, firms the look of skin, and provides essential antioxidant protection. -African Red Tea: Supports antiaging and strengthening the skin’s outer layer; calms and soothes the skin.',
